import ButtonFooter from "./ButtonFooter";

const Footer = ({setTodo}) => {
    return (
        <footer>
            <ButtonFooter title='Удалить все эллементы' onClick={() => setTodo([])}/>
            <ButtonFooter title='Показать все эллементы'/>
            <ButtonFooter title='Законченные дела'/>
            <ButtonFooter/>
        </footer>
    )
}

export default Footer;
